class Solution:
    def findTheDifference(self, s, t):
        d1 = {}
        d2 = {}
        a = 0
        b = 0
        for i in t:
            if i not in d1:
                d1.update({i: a+1})
            else:
                d1.update({i: d1[i]+1})

        for j in s:
            if j not in d2:
                d2.update({j: b+1})
            else:
                d2.update({j: d2[j]+1})

        print(d1)
        print(d2)
        
        if len(d1) > len(d2):
            for k in d1:
                if k not in d2:
                    return k
        else:
            for j in d1:
                if j in d2:
                    if d1.get(j) != d2.get(j):
                        return j

